import React, { Component, useState } from 'react';

import './App.css';
import { Map, TileLayer, GeoJSON, Marker, Popup, CircleMarker ,Tooltip,
  LayersControl,
  LayerGroup,
  Circle, FeatureGroup, Rectangle } from 'react-leaflet';

  import { library } from '@fortawesome/fontawesome-svg-core';
  import { faRunning, faGamepad, faLaptopHouse, faHamburger, faFilm } from '@fortawesome/free-solid-svg-icons';


import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

import Control from 'react-leaflet-control';
import data2 from 'geojson-world-map';
import data1 from './sample.json';
import data3 from './us-states.json';
import data4 from './esa09.json';
import data8 from './file_copy.json';
import data from './data7984821864271563851.json';
import features from './features.json';
import cities from './cities.json';
import sidney from './sidney.geojson';
import data0 from './census.json';
import data6 from './multipoly.json';
import data77 from './census.json';
import { LatLng } from 'leaflet';

import activities from './activities.json';
import { Container, Row, Col } from 'react-bootstrap';
import { Activity } from './Activity'

library.add(faRunning, faGamepad, faLaptopHouse, faHamburger, faFilm); 

const { BaseLayer, Overlay } = LayersControl
//https://data.gov.au/geoserver/nsw-suburb-locality-boundaries-psma-administrative-boundaries/wfs?request=GetFeature&typeName=ckan_91e70237_d9d1_4719_a82f_e71b811154c6&outputFormat=json
//const center = [-23.116667, 132.133333]
//const center = [ -33.807908, 151.0007289 ]
const center = [-33.834905,150.9673231]
const rectangle = [
  [51.49, -0.08],
  [51.5, -0.06],
]
const layerStyle = {
  display: 'none',
  float: 'right'
}
function getColor(d) {
    //d.properties.loc_pid.startsWith('NSW') ? '#800026' :
    return d > 1000 ? '#800026' :
           d > 500  ? '#BD0026' :
           d > 200  ? '#E31A1C' :
           d > 100  ? '#FC4E2A' :
           d > 50   ? '#FD8D3C' :
           d > 20   ? '#FEB24C' :
           d > 10   ? '#FED976' :
                      '#FFEDA0';
}

class App extends Component {
  state = {
    todos: [],
    showMyComponent: false,
    ordered: false,
    selected: 'exercise'
  }

  setSelected = (activity) => {
    console.log("setSelected: "+activity);
    this.setState({ selected: activity })
  }

  render() {

    console.log("returning: ")
    return (
      <div>
        <h3 style={{ textAlign: "center" }}>Most Populous Cities inÂ Asia</h3>
        <Map center={center} zoom={9} style={{ width: "80vh", height: "100vh" }}>

        <LayersControl position="topright">
        <BaseLayer checked="checked" name="Black and White">
            <TileLayer
              attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
              url="https://tiles.wmflabs.org/bw-mapnik/{z}/{x}/{y}.png"
            />
          </BaseLayer>
        <BaseLayer name="Colored">
            <TileLayer
              attribution='&amp;copy <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
            />
          </BaseLayer>

        {cities.map((city, k) => {
            return (
              <CircleMarker
                key={k}
                center={[city["coordinates"][1], city["coordinates"][0]]}
                radius={5 * Math.log(city[this.state.selected] / 100000)}
                fillOpacity={0.5}
                stroke={true}
              >
                <Tooltip direction="right" offset={[-8, -2]} opacity={1}>
                  <strong>{city["name"]}</strong>
                  <span>{city["id"] + " " + city[this.state.selected]}</span>
                </Tooltip>
              </CircleMarker>
            );
          })}
          <Overlay name="Imagination">
          <LayerGroup>
          <GeoJSON
          data={features}
          style={(feature) => ({
            color: '#4a83ec',
            weight: 0.5,
            fillColor: '#4a83ec',//getColor(feature),
            fillOpacity: 0.7,
          })}
        />
         <Marker position={[50, 10]}>
          <Popup>
            Popup for any custom information.
          </Popup>
        </Marker>
        </LayerGroup>
          </Overlay>
          <Overlay name="Economic Status">
            <LayerGroup>
          <GeoJSON
          data={data}
          style={(feature) => ({
            color: '#4a83ec',
            weight: 0.5,
            fillColor: '#4a83ec',//getColor(feature),
            fillOpacity: 0.7,
          })}
        />
         <Marker position={[50, 10]}>
          <Popup>
            Popup for any custom information.
          </Popup>
        </Marker>
        </LayerGroup>
          </Overlay>
          </LayersControl>
          { this.state.showMyComponent && 
            <LayerGroup style={layerStyle}>
              <Circle center={center} fillColor="blue" radius={200} />
              <Circle
                center={center}
                fillColor="red"
                radius={100}
                stroke={false}
              />
              <LayerGroup>
                <Circle
                  center={[51.51, -0.08]}
                  color="green"
                  fillColor="green"
                  radius={100}
                />
              </LayerGroup>
            </LayerGroup>
            }

      <Control position="topleft" >
        <button 
          onClick={ () => this.setState({showMyComponent: !this.state.showMyComponent}) }
        >
          Reset View
        </button>
        <Container>
        <Row>
        {activities.map(activities => (
          <Col className="mb-5">
            <Activity activities={activities} key={activities.id} setSelected={this.setSelected} />
          </Col>
        ))}
        </Row>
        </Container>
      </Control>
</Map>

      </div>          
    );
  }
}

export default App;
